import React from "react";
import './components/Navbar.css'

function Navbar(){
    return (
        <nav>
            <ul>
                <li>Home</li>
                <li>About Me</li>
                <li>Projects</li>
                <li>Contact Me</li>
            </ul>
        </nav>
    )
}

export default Navbar;
